import React from 'react'
import ProjectCard from './ProjectCard';
import './Projects.css'

function Projects() {
    return (
        <div className='projects'>
            <p>Projects</p>
            <div className="projects__card"></div>
            <ProjectCard 
            image='data:image/jpeg;base64,'/>
        </div>
    )
}

export default Projects
